#
# Structure for table "fa_answer"
#

DROP TABLE IF EXISTS `fa_answer`;
CREATE TABLE `fa_answer` (
  `answer_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `ans` enum('A','B','C','D') NOT NULL COMMENT '选项',
  `title` varchar(1024) NOT NULL COMMENT '答案内容',
  `is_answer` enum('1','0') NOT NULL COMMENT '正确答案:0=不是,1=是',
  `question_id` int(11) NOT NULL COMMENT '问题id',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `details` text COMMENT '详情',
  PRIMARY KEY (`answer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='答案表';

