#
# Structure for table "fa_answer_record"
#

DROP TABLE IF EXISTS `fa_answer_record`;
CREATE TABLE `fa_answer_record` (
  `answer_record_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '答题记录id',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `status` enum('10','20') NOT NULL COMMENT '状态:10=通过,20=不通过',
  `user_id` int(11) NOT NULL COMMENT '用户id',
  `category` enum('10','20') NOT NULL COMMENT '类型:10=购房资格,20=刚需资格',
  `questions_id` varchar(256) NOT NULL COMMENT '问题(以,拼接)',
  `answers_id` varchar(256) NOT NULL COMMENT '答案(以,拼接)',
  PRIMARY KEY (`answer_record_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='答题记录表';

