#
# Structure for table "fa_article"
#

DROP TABLE IF EXISTS `fa_article`;
CREATE TABLE `fa_article` (
  `article_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `title` varchar(256) NOT NULL COMMENT '标题',
  `image` varchar(256) NOT NULL COMMENT '封面图片',
  `details` text NOT NULL COMMENT '内容',
  `author` varchar(64) NOT NULL COMMENT '来源',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `is_recommend` enum('10','20') NOT NULL DEFAULT '10' COMMENT '热门推荐:10=不推荐,20=推荐',
  `author_avatar` varchar(256) NOT NULL COMMENT '来源头像',
  PRIMARY KEY (`article_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='文章表';

