#
# Structure for table "fa_building"
#

DROP TABLE IF EXISTS `fa_building`;
CREATE TABLE `fa_building` (
  `building_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '楼盘id',
  `category` enum('10','20','30','40','50','60') NOT NULL COMMENT '楼盘类型:10=热搜楼盘,20=最新推荐,30=即将预售,40=最新摇号,50=摇号剩余,60=其它',
  `name` varchar(64) NOT NULL COMMENT '楼盘名称',
  `alias` varchar(64) NOT NULL COMMENT '楼盘别名',
  `detail_img` varchar(256) NOT NULL COMMENT '详情页主图',
  `thumbnail_img` varchar(256) NOT NULL COMMENT '前端展示页图',
  `status` enum('10','20','30','40','50') NOT NULL COMMENT '楼盘状态:10=在售,20=代售,30=商办,40=不限购,50=即将预售',
  `renovation` enum('10','20','30') NOT NULL COMMENT '装修标签:10=清水房,20=简装,30=精装',
  `class` enum('10','20','30','40','50') NOT NULL COMMENT '楼盘类型:10=住宅,20=公寓,30=写字楼,40=商铺,50=别墅',
  `sale` enum('10','20','30','40') NOT NULL COMMENT '售卖:10=待售,20=即将预售,30=在售,40=已清盘',
  `house_price` decimal(10,2) NOT NULL COMMENT '参考单价',
  `total_price` decimal(10,2) NOT NULL COMMENT '参考总价',
  `is_hot` enum('10','20') NOT NULL DEFAULT '10' COMMENT '是否首页推荐:10=不推荐,20=推荐',
  `address` varchar(256) NOT NULL COMMENT '楼盘地址',
  `longitude` varchar(256) NOT NULL COMMENT '经度',
  `latitude` varchar(256) NOT NULL COMMENT '纬度',
  `developer` varchar(256) DEFAULT NULL COMMENT '开发商',
  `use_time` int(11) DEFAULT NULL COMMENT '产权年限',
  `green` decimal(10,2) DEFAULT NULL COMMENT '绿化率',
  `volume` decimal(10,2) DEFAULT NULL COMMENT '容积率',
  `parking` int(11) DEFAULT NULL COMMENT '车位信息',
  `traffic` varchar(256) DEFAULT NULL COMMENT '环线数',
  `addr_area` decimal(10,2) DEFAULT NULL COMMENT '之地面积',
  `buld_area` decimal(10,2) DEFAULT NULL COMMENT '建筑面积',
  `complete_time` datetime DEFAULT NULL COMMENT '交房时间',
  `building` int(11) DEFAULT NULL COMMENT '楼栋总数',
  `householder` int(11) DEFAULT NULL COMMENT '总产数',
  `floor` int(11) DEFAULT NULL COMMENT '建筑楼层',
  `property` varchar(256) DEFAULT NULL COMMENT '物业公司',
  `synopsis` text COMMENT '楼盘简介',
  `is_user` enum('10','20') NOT NULL COMMENT '是否用户上传:10=爬虫,20=用户上传',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `real_images` text NOT NULL COMMENT '实景图',
  `periphery_images` text NOT NULL COMMENT '周边图',
  `template_images` text NOT NULL COMMENT '样板图',
  `effect_images` text NOT NULL COMMENT '效果图',
  `bird_images` text NOT NULL COMMENT '鸟瞰图',
  PRIMARY KEY (`building_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='楼盘表';

