DROP TABLE IF EXISTS `fa_building_apartment`;
CREATE TABLE `fa_building_apartment` (
  `building_apartment_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `image` varchar(256) NOT NULL COMMENT '户型图片链接',
