  `createtime` datetime NOT NULL COMMENT '创建时间',
  `orientation` varchar(64) NOT NULL COMMENT '朝向:10=北,20=东,30=南,40=西',
  `sale` int(11) NOT NULL COMMENT '售卖状态:10=待售,20=在售,30=售罄',
  PRIMARY KEY (`building_apartment_id`)
